<main>
  <div id="main-content" class="relative w-full h-full p-4 mx-auto overflow-y-auto text-center rounded-lg max-w-screen-2xl bg-gray-50 dark:bg-gray-900">
    <h1 class="mb-4 text-3xl font-extrabold text-gray-900 dark:text-white md:text-5xl lg:text-6xl">
      Welcome to<span class="text-transparent bg-clip-text bg-gradient-to-r to-emerald-600 from-sky-400"> GBrowser</span>
